import React from 'react'

//data
import { data } from './../data'

//components
import FunctionIcon from './FunctionIcon'

const FunctionUI = ({ leng }) => {

    return (
        <div>
            <div className="func-description">
                {data[leng].function.description[0]}
                <FunctionIcon />
                {data[leng].function.description[1]}
            </div>

        <div>  {data[leng].function.description[1]}</div>
        </div>
    )
}

export default FunctionUI;
